import { StyleSheet } from "react-native"


const styles = StyleSheet.create({

    footer:{
        
        display: 'flex',
        
        backgroundColor: 'white',
        flexDirection: 'row',
        justifyContent: 'space-around',
        gap: 50,
        bottom: 0,
        position: 'fixed',
        left: 0

        }
})

export default styles;
